import React from 'react';
import { AppBar, Typography, Paper } from '@material-ui/core';
import { Tabs, Tab } from '@material-ui/core';

function LinkTab(props) {
  return <Tab component="a" onClick={event => event.preventDefault()} {...props} />;
}

const Header = (props) => {
  const value = props.value;
  const handler = props.handleChange;
  return (
    <div>
    <AppBar position="static">
      <Tabs value={value} onChange={handler}>
        <LinkTab label="Home" href="home" />
        <LinkTab label="Sarees" href="sarees" />
        <LinkTab label="Contact us" href="contact-us" />
      </Tabs>
    </AppBar>
    </div>
  );
}

export default Header;
